import React, { useState,useEffect} from 'react'
import"../UI/UserView.css"
import Component from './Component'
let components=
function UserView() {
    const [count,setCount]=useState()
   const displayCount=(id)=>{
     if(count[id-1].value===null)
     {
       let temp = count;
       temp[id-1].value=0
      setCount([...temp])
     }
   }
   useEffect(() => {
     fetch("http://localhost:3000/components").then(Response=> Response.json()).then(result=>{
        setCount(result)
       }
        )
   }, [])


  return (
      <div className="parent">
          <div className='heding'><h1>Tik-Tac-Toe</h1></div>
    <div className='main-comp'>
      {
          count.map((index)=>{
            return <Component key={index.id} count={index} displayCount={displayCount }/>
          })

      }
    </div>
    </div>
  )
}

export default UserView
